import { createApi, fetchBaseQuery } from "@reduxjs/toolkit/query/react"

export const authSlice = createApi({
    reducerPath: 'authApi',
    baseQuery: fetchBaseQuery({
        baseUrl:'http://localhost6060',

    }),
    endpoints: (builder) => ({
        getSingUp: builder.query({
            query: () => '/api/v1/admin/signup'
        })
    })

})
